import React from 'react'
import { Col, Row } from 'react-bootstrap';

 const DateCount = ({data}) => {
  return (
       <Row className=" ">
          <Col sm="8" className='fs-5 '>
            <div className='title'>
           <h1></h1> 
            <input type='search' placeholder='Search'/>
            </div>
          </Col>
        </Row>
  )
}
export default DateCount;
